package rieit.page;

public class HandlingLocator {
	public HandlingLocator(String nm, String idnew) {
		// TODO Auto-generated constructor stub
		name = nm;
		id = idnew;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		name = name;
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		
		id = id;
	}

	private String name;
	private String id;

}
